import React from "react";
function HelloDiv() {
  return (<div>
    <h1>Hello! My name is Elizabeth</h1>
    <p>Things I Like:</p>
    <ul>
      <li>Travel</li>
      <li>Hiking</li>
      <li>Coffee</li>
      <li>Dogs</li>

    </ul>
    </div>
  )}

export default HelloDiv;
